import './App.css';
import {Header, Body, Footer} from './components/index';

function App() {
  return (
    <div className='container'>
      <div>
        <Header />
      </div>
      <div>
        <Body />
      </div>
      <div>
        <Footer />
      </div>


    </div>
  );
}

export default App;
